import React, { useState } from "react";
import Form from 'react-bootstrap/Form';
import "./SignForm.css"
import logoo from "./Assets/arrow.png"

const SignInForm = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault(); // Prevent the form from submitting and refreshing the page
    // You can access the email and password state values here and perform your submission logic
    console.log("Email:", email);
    console.log("Password:", password);
  };

  return (
    <div className="signn">
      <p>Sign In</p>
      <Form onSubmit={handleSubmit}>
        <div className="txt_field">
          <label>Email Address</label>
          <input type="email" required value={email} onChange={(e) => setEmail(e.target.value)} />
        </div>
        <div className="txt_field">
          <label>Password</label>
          <input type="password" required value={password} onChange={(e) => setPassword(e.target.value)} />
        </div>
        <button type="submit" className="signin-button">SIGN IN
          <div className="logocontainer"><img src={logoo} width={20} height={20} /></div>
        </button>
      </Form>
    </div>
  );
};

export default SignInForm;
